import styled from 'styled-components';

const LogoWrapper = styled.div`
  width: 40%;
  height: 90%;
  display: flex;
  justify-content: center;
`;

const ChatWrapper = styled.div`
  width: 40%;
  height: 90%;
  display: flex;
  background-color: grey;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  text-align: center;
  overflow: auto;
`;

export { LogoWrapper, ChatWrapper };
